import React from 'react';

const teamMembers = [
  {
    id: 1,
    name: 'John Doe',
    position: 'Chief Executive Officer',
    image: '/img/ceo.jpg',
    description: 'John has over 20 years of experience in real estate development and leads our team with visionary expertise.'
  },
  {
    id: 2,
    name: 'Jane Smith',
    position: 'Chief Operations Officer',
    image: '/img/coo.jpg',
    description: 'Jane ensures the smooth operation of all projects, making sure every detail is perfect.'
  },
  {
    id: 3,
    name: 'David Brown',
    position: 'Chief Financial Officer',
    image: '/img/cfo.jpg',
    description: 'David is responsible for overseeing the financial health of the company, ensuring sustainable growth.'
  },
  {
    id: 4,
    name: 'Lisa White',
    position: 'Head of Marketing',
    image: '/img/marketing-head.jpg',
    description: 'Lisa spearheads all marketing efforts, bringing our properties to the attention of the right audience.'
  }
];

const Team = () => {
  return (
    <section className="team-section">
      <div className="container">
        <h2 className="section-title">Meet Our Leadership Team</h2>
        <p className="section-subtitle">Our key leaders drive innovation and excellence in the property industry.</p>
        <div className="team-members">
          {teamMembers.map((member) => (
            <div className="team-card" key={member.id}>
              <div className="team-img-container">
                <img src={member.image} alt={member.name} className="team-img" />
              </div>
              <div className="team-info">
                <h3>{member.name}</h3>
                <p className="team-position">{member.position}</p>
                <p className="team-description">{member.description}</p>
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Team;
